import { useSelector } from "react-redux";

const GetPosts = () => {
  const user = useSelector((state) => state.profileUser);
  console.log(user.Posts.id);
  return (
    <>
      {user &&
        user.Posts.map((us) => {
          return (
            <>
              <h1>{us.id}</h1>;<h1>{us.comment}</h1>;
            </>
          );
        })}
    </>
  );
};

export default GetPosts;
